nt of credential compromise, you can prevent an attacker from exploiting the risks mentioned above, in addition to preventing mass deletion, destruction, or modification of existing infrastructure.</p> <p>However, this tool does not attempt to understand the context behind everything in your AWS account. It&#39;s possible to understand the context behind some of these things programmatically - whether the policy is applied to an instance profile, whether the policy is attached, whether inline IAM policies are in use, and whether or not AWS Managed Policies are in use. <strong>Only you know the context behind the design of your AWS infrastructure and the IAM strategy</strong>.</p> <p>For example, an AWS Lambda policy used as a simple service checking the configuration of AWS infrastructure might be a good use case for resource constraints. Conversely, perhaps you applied the AdministratorAccess AWS-managed policy to an Instance Profile so that an EC2 instance can run Terraform to provision AWS resources via Infrastructure as Code. In the second example, the role is extremely permissive <strong>by design</strong> - and a tool can&#39;t automatically understand that context.</p> <p>As such, the tool aims to:</p> <ul> <li>Map out your risk landscape of IAM identity-based policies, enumerating the potential risks for a full IAM threat model</li> <li>Identify where you can reduce the blast radius in the case of credentials compromise</li> <li>Help you prioritize which ones to remediate</li> <li>Provide a straightforward workflow to remediate</li> <li>Provide a sufficient exclusions mechanism to programmatically define where deviations from resource constraints are by design</li> </ul> <h5 id="assessment-recap">Assessment Recap</h5> <p>To recap: you&#39;ve followed these steps to generate this report:</p> <ul> <li>Downloaded the Account Authorization details JSON file</li><ul> <li><code>cloudsplaining download --profile default --output default-account-details.json</code></li> </ul>  <li>Generated your custom exclusions file</li><ul> <li><code>cloudsplaining create-exclusions-file --output-file exclusions.yml</code></li> </ul>  <li>Generated the report <code>cloudsplaining scan --input-file default-account-details.json --exclusions-file exclusions.yml</code></li> <li>This generates (1) The single-file HTML report and the raw JSON data file</li> </ul> <h5 id="triaging-workflow">Triaging workflow</h5> <p>An assessor can follow this general workflow:</p> <ul> <li>Open a ticket in your organization&#39;s project management tool of choice (for example, JIRA or Salesforce) in the AWS account owner&#39;s project</li> <li>Attach the HTML report, JSON Data file, and CSV worksheet</li> <li>Ask the service/account owner team to fill out the Triage worksheet</li> </ul> <p>When you ask the service/account owner team to fill out the Triage CSV worksheet, you can use some text like the following:</p> <blockquote> <p>As part of our security assessment, our team ran Cloudsplaining on your AWS account. Cloudsplaining maps out the IAM risk landscape in a report, identifies where resource ARN constraints are not in use, and identifies other risks in IAM policies like Privilege Escalation, Data Exfiltration, and Resource Exposure/Permissions management. Remediating these issues, where applicable, will help to limit the blast radius in the case of compromised AWS credentials. We request that you review the HTML report and fill out the &quot;Justification&quot; field in the Triage worksheet. Based on the corresponding details in the HTML report, provide either (1) A justification on why the result is a False Positive, or (2) Identify that it is a legitimate finding.</p> </blockquote> <h5 id="triaging-considerations">Triaging considerations</h5> <p>When triaging your results, consider some of the factors listed below as you identify False Positives vs. legitimate findings. <strong>There are some scenarios where <code>&quot;Resource&quot;: &quot;*&quot;</code> access is by design and is therefore a false positive. This section covers some of the common scenarios.</strong></p> <p><strong>Infrastructure Creation roles</strong>:</p> <p> IAM roles that create infrastructure via Infrastructure as Code Technologies (for example, Terraform or CloudFormation) require high permission levels to provision AWS infrastructure. These will usually be false positives. When you see these instances, make sure that these roles are adequately protected. For instance, make sure that roles within the AWS account are not able to assume this role or affect its configuration in any way. Additionally, consider restricting the trust policy so that a set of explicitly stated IAM principals are the only ones who can assume that role. Take special care to audit instances of <code>sts:AssumeRole</code> within this AWS account.</p> <p><strong>System roles vs. User Roles</strong>: System roles - IAM Roles applied to compute services, such as EC2 Instance Profiles, ECS Task Execution roles, or Lambda Task Execution roles - should almost always leverage resource ARN constraints for actions that perform &quot;Write&quot; actions. Exceptions to this could include Infrastructure provisioning or other edge cases.</p> <p>Conversely, user roles will almost always be used against <code>*</code> resources for the sake of convenience, innovation, and avoiding overly restrictive limitations. In the user role scenario, consider:</p> <ul> <li><strong>Design context</strong>: is it appropriate? (For instance, maybe all your user roles don&#39;t need <code>iam:*</code>)</li> <li><strong>Environment</strong>: If this is a Dev environment, frequently-used user roles probably allow more permissions for innovation purposes. However, in later environments - especially production - commonly used user roles should be read-only - or the more permissive ones should be for break-glass scenarios only.</li> <li><strong>Regardless of the context</strong>: there should <strong>always</strong> be security guardrails in place, like <a href="https://docs.aws.amazon.com/organizations/latest/userguide/orgs_manage_policies_scp.html">Service Control Policies through AWS Organizations</a> or <a href="https://docs.aws.amazon.com/IAM/latest/UserGuide/access_policies_boundaries.html">IAM Permissions Boundaries</a> to prevent against egregious mistakes.</li> </ul> <p><strong>Organization-specific results</strong></p> <p>For example, perhaps you allow kms:Decrypt for * resources (by design) in your organization for one reason or another. Cloudsplaining flags this as a result. However, there are mitigating controls in place. Firstly, you leverage strict resource-based KMS key policies to lock down all KMS keys, explicitly stating individual IAM principals that are allowed to use them. Secondly, you provision all KMS keys with CloudFormation or Terraform, so you are confident that this pattern is consistent across all KMS keys in your AWS accounts. Therefore, <code>kms:Decrypt</code> to <code>*</code> resources is not a finding you are concerned about. In this case, you decide it is acceptable to exclude <code>kms:Decrypt</code> from your results.</p> <h5 id="common-false-positive-scenarios">Common False Positive Scenarios</h5> <p><strong>Conditions Logic</strong>:</p> <p>This tool does not evaluate <a href="https://docs.aws.amazon.com/IAM/latest/UserGuide/reference_policies_elements_condition.html">IAM Conditions</a> logic. If your policies use wildcard resources but restrict according to condition keys, then it&#39;s possible this is a false positive. However, you might want to double-check the accuracy of the conditions logic in those IAM policies. While IAM conditions can be extremely powerful, implementation is also prone to human error. We suggest leveraging <a href="https://github.com/duo-labs/parliament/">Parliament by Duo Labs</a> (courtesy of <a href="https://twitter.com/0xdabbad00">Scott Piper</a>), to lint your policies for accuracy - especially when IAM conditions are in use.</p> <p><strong><code>logs:CreateLogGroup</code> and <code>logs:PutLogEvent</code></strong>:</p> <p>Depending on how your organization approaches CloudWatch Logs Agent configuration, IAM, and CloudWatch Logs Group naming conventions, it is sometimes near-impossible to prevent cross-contamination of logs or Log Injection to the Log Streams from other instance IDs. Cross-Contamination of CloudWatch Logs is an issue of its own that is definitely beyond the scope of this document - but consider this as a potential limitation by AWS when trying to identify a remediation plan.</p> <h5 id="building-the-exclusions-file">Building the Exclusions File</h5> <p>After you have identified the False Positives, add the False Positive criteria to your custom Cloudsplaining exclusions file. The False Positives generally fall into one of two categories:</p> <ul> <li>False positives that will occur across all of your AWS accounts, due to your organization-wide implementation strategy</li> <li>False positives specific to this AWS account</li> </ul> <p>To make the exclusions file, create a YAML file that we will use to list out exclusions with the <code>create-exclusions-file</code> command.</p> <pre><code class="language-bash">cloudsplaining create-exclusions-file</code></pre> <p>This will generate a file titled <code>exclusions.yml</code> in your current directory.</p> <p> The default exclusions file contains these contents:</p> <pre><code class="language-yaml"># Policy names to exclude from evaluation\n# Suggestion: Add policies here that are known to be overly permissive by design, after you run the initial report.\npolicies:\n  - &quot;AWSServiceRoleFor*&quot;\n  - &quot;*ServiceRolePolicy&quot;\n  - &quot;*ServiceLinkedRolePolicy&quot;\n  - &quot;AdministratorAccess&quot; # Otherwise, this will take a long time\n  - &quot;service-role*&quot;\n  - &quot;aws-service-role*&quot;\n# Don&#39;t evaluate these roles, users, or groups as part of the evaluation\nroles:\n  - &quot;service-role*&quot;\n  - &quot;aws-service-role*&quot;\nusers:\n  - &quot;&quot;\ngroups:\n  - &quot;&quot;\n# Read-only actions to include in the results, such as s3:GetObject\n# By default, it includes Actions that could lead to Data Exfiltration\ninclude-actions:\n  - &quot;s3:GetObject&quot;\n  - &quot;ssm:GetParameter&quot;\n  - &quot;ssm:GetParameters&quot;\n  - &quot;ssm:GetParametersByPath&quot;\n  - &quot;secretsmanager:GetSecretValue&quot;\n# Write actions to include from the results, such as kms:Decrypt\nexclude-actions:\n  - &quot;&quot;</code></pre> <p>Add whatever values you want to the above depending on your organization&#39;s context.</p> <ul> <li>Under <code>policies</code>, list the path of policy names that you want to exclude.</li> <li>If you want to exclude a role titled <code>MyRole</code>, list <code>MyRole</code> or <code>MyR*</code> in the <code>roles</code> list.</li> <li>You can follow the same approach for <code>users</code> and <code>groups</code> list.</li> </ul> <ul> <li>Now, run the scan to generate a <em>new</em> Cloudsplaining report that considers your exclusions criteria. This way, you are working with a report version that consists of True Positives only.</li> </ul> <pre><code class="language-bash">cloudsplaining scan --input-file default.json --exclusions-file exclusions.yml</code></pre> <p>You can now proceed to the Remediation stage.</p> ';e.exports=a},"5a34":function(e,t,a){var n=a("44e7");e.exports=function(e){if(n(e))throw TypeError("The method doesn't accept regular expressions");return e}},"5a43":function(e,t){function a(e,t){(null==t||t>e.length)&&(t=e.length);for(var a=0,n=new Array(t);a<t;a++)n[a]=e[a];return n}e.exports=a},"5aff":function(e,t,a){(function(e,t){t(a("c1df"))})(0,(function(e){"use strict";

mission capability to an extent the application is able to perform its primary functions, but their effectiveness is reduced and there may be damage to the organization&#39;s assets.</li> <li><strong>Low</strong>: Results in limited degradation in mission capability; the organization is able to perform its primary functions, but their effectiveness is noticeably reduced and may result in minor damage to the organization&#39;s assets.</li> </ul> <h5 id="privilege-escalation">Privilege Escalation</h5> <p>These policies allow a combination of IAM actions that allow a principal with these permissions to escalate their privileges - for example, by creating an access key for another IAM user, or modifying their own permissions. This research was pioneered by <a href="https://twitter.com/SpenGietz">Spencer Gietzen</a> at Rhino Security Labs. Remediation Guidance can be found <a href="https://rhinosecuritylabs.com/aws/aws-privilege-escalation-methods-mitigation/">here</a>.</p> <h5 id="resource-exposure">Resource Exposure</h5> <p>Resource Exposure actions allow modification of Permissions to <a href="https://docs.aws.amazon.com/IAM/latest/UserGuide/access_policies_identity-vs-resource.html">resource-based policies</a> or otherwise can expose AWS resources to the public via similar actions that can lead to resource exposure - for example, the ability to modify <a href="https://docs.aws.amazon.com/ram/latest/userguide/what-is.html">AWS Resource Access Manager</a>.</p> <h5 id="infrastructure-modification">Infrastructure Modification</h5> <p>Infrastructure Modification describes IAM actions with &quot;modify&quot; capabilities, and can therefore lead to <a href="https://attack.mitre.org/techniques/T1496/">Resource Hijacking</a>, unauthorized creation of Infrastructure, Backdoor creation, and/or modification of existing resources which can result in downtime.</p> <h5 id="data-exfiltration">Data Exfiltration</h5> <p>Policies with Data Exfiltration potential allow certain read-only IAM actions without resource constraints, such as <code>s3:GetObject</code>, <code>ssm:GetParameter*</code>, or <code>secretsmanager:GetSecretValue</code>. Unrestricted <code>s3:GetObject</code> permissions has a long history of customer data leaks. <code>ssm:GetParameter*</code> and <code>secretsmanager:GetSecretValue</code> are both used to access secrets. <code>rds:CopyDBSnapshot</code> and <code>rds:CreateDBSnapshot</code> can be used to exfiltrate RDS database contents.</p> <h5 id="service-wildcard">Service Wildcard</h5> <p>&quot;Service Wildcard&quot; is an unofficial way of referring to IAM policy statements that grant access to ALL actions under a service - like <code>s3:*</code>. Prioritizing the remediation of policies with this characteristic can help to efficiently reduce the total count of high risk issues in the Cloudsplaining report.</p> <h5 id="credentials-exposure">Credentials Exposure</h5> <p>Credentials Exposure actions return credentials as part of the API response , such as <code>ecr:GetAuthorizationToken</code>, <code>iam:UpdateAccessKey</code>, and others. The full list is below.</p> <ul> <li><a href="https://docs.aws.amazon.com/codepipeline/latest/APIReference/API_PollForJobs.html">codepipeline:pollforjobs</a></li> <li><a href="https://docs.aws.amazon.com/cognitoidentity/latest/APIReference/API_GetOpenIdToken.html">cognito-identity:getopenidtoken</a></li> <li><a href="https://docs.aws.amazon.com/cognitoidentity/latest/APIReference/API_GetOpenIdTokenForDeveloperIdentity.html">cognito-identity:getopenidtokenfordeveloperidentity</a></li> <li><a href="https://docs.aws.amazon.com/cognitoidentity/latest/APIReference/API_GetCredentialsForIdentity.html">cognito-identity:getcredentialsforidentity</a></li> <li><a href="https://docs.aws.amazon.com/connect/latest/APIReference/API_GetFederationToken.html">connect:getfederationtoken</a></li> <li><a href="https://docs.aws.amazon.com/connect/latest/APIReference/API_GetFederationToken.html">connect:getfederationtokens</a></li> <li><a href="https://docs.aws.amazon.com/AmazonECR/latest/APIReference/API_GetAuthorizationToken.html">ecr:getauthorizationtoken</a></li> <li><a href="https://docs.aws.amazon.com/gamelift/latest/apireference/API_RequestUploadCredentials.html">gamelift:requestuploadcredentials</a></li> <li><a href="https://docs.aws.amazon.com/IAM/latest/APIReference/API_CreateAccessKey.html">iam:createaccesskey</a></li> <li><a href="https://docs.aws.amazon.com/IAM/latest/APIReference/API_CreateLoginProfile.html">iam:createloginprofile</a></li> <li><a href="https://docs.aws.amazon.com/IAM/latest/APIReference/API_CreateServiceSpecificCredential.html">iam:createservicespecificcredential</a></li> <li><a href="https://docs.aws.amazon.com/IAM/latest/APIReference/API_ResetServiceSpecificCredential.html">iam:resetservicespecificcredential</a></li> <li><a href="https://docs.aws.amazon.com/IAM/latest/APIReference/API_UpdateAccessKey.html">iam:updateaccesskey</a></li> <li><a href="https://docs.aws.amazon.com/lightsail/2016-11-28/api-reference/API_GetInstanceAccessDetails.html">lightsail:getinstanceaccessdetails</a></li> <li><a href="https://docs.aws.amazon.com/lightsail/2016-11-28/api-reference/API_GetRelationalDatabaseMasterUserPassword.html">lightsail:getrelationaldatabasemasteruserpassword</a></li> <li><a href="https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/UsingWithRDS.IAMDBAuth.IAMPolicy.html">rds-db:connect</a></li> <li><a href="https://docs.aws.amazon.com/redshift/latest/APIReference/API_GetClusterCredentials.html">redshift:getclustercredentials</a></li> <li><a href="https://docs.aws.amazon.com/singlesignon/latest/PortalAPIReference/API_GetRoleCredentials.html">sso:getrolecredentials</a></li> <li><a href="https://docs.aws.amazon.com/mediapackage/latest/apireference/channels-id-credentials.html">mediapackage:rotatechannelcredentials</a></li> <li><a href="https://docs.aws.amazon.com/mediapackage/latest/apireference/channels-id-ingest_endpoints-ingest_endpoint_id-credentials.html">mediapackage:rotateingestendpointcredentials</a></li> <li><a href="https://docs.aws.amazon.com/cli/latest/reference/sts/assume-role.html">sts:assumerole</a></li> <li><a href="https://docs.aws.amazon.com/cli/latest/reference/sts/assume-role-with-saml.html">sts:assumerolewithsaml</a></li> <li><a href="https://docs.aws.amazon.com/cli/latest/reference/sts/assume-role-with-web-identity.html">sts:assumerolewithwebidentity</a></li> <li><a href="https://docs.aws.amazon.com/cli/latest/reference/sts/get-federation-token.html">sts:getfederationtoken</a></li> <li><a href="https://docs.aws.amazon.com/cli/latest/reference/sts/get-session-token.html">sts:getsessiontoken</a></li> </ul> <h5 id="roles-assumable-by-compute-services">Roles Assumable by Compute Services</h5> <p>IAM Roles can be assumed by AWS Compute Services (such as EC2, ECS, EKS, or Lambda) can present greater risk than user-defined roles, especially if the AWS Compute service is on an instance that is directly or indirectly exposed to the internet. Flagging these roles is particularly useful to penetration testers (or attackers) under certain scenarios. For example, if an attacker obtains privileges to execute <a href="https://docs.aws.amazon.com/systems-manager/latest/APIReference/API_SendCommand.html">ssm:SendCommand</a> and there are privileged EC2 instances with the SSM agent installed, they can effectively have the privileges of those EC2 instances. Remote Code Execution via AWS Systems Manager Agent was already a known escalation/exploitation path, but Cloudsplaining can make the process of identifying theses cases easier.</p> <h5 id="trust-policy">Trust Policy</h5> <p>A JSON policy document in which you define the principals that you trust to assume the role. A role trust policy is a required resource-based policy that is attached to a role in IAM. The principals that you can specify in the trust policy include users, roles, accounts, and services.</p> <p>This definition was taken from the AWS Documentation <a href="https://docs.aws.amazon.com/IAM/latest/UserGuide/id_roles_terms-and-concepts.html#term_trust-policy">here</a>.</p> <h5 id="principal">Principal</h5> <p>An entity in AWS that can perform actions and access resources. A principal can be an AWS account root user, an IAM user, or a role.</p> <h5 id="role">Role</h5> <p>An IAM identity that you can create in your account that has specific permissions. An IAM role has some similarities to an IAM user. Roles and users are both AWS identities with permissions policies that determine what the identity can and cannot do in AWS. However, instead of being uniquely associated with one person, a role is intended to be assumable by anyone who needs it. Also, a role does not have standard long-term credentials such as a password or access keys associated with it. Instead, when you assume a role, it provides you with temporary security credentials for your role session.</p> <p>We are particularly interested in roles used for <strong>compute services</strong> - i.e., Compute Service Roles.</p> <p>This definition was taken from the AWS Documentation <a href="https://docs.aws.amazon.com/IAM/latest/UserGuide/id_roles_terms-and-concepts.html#iam-term-role">here</a>.</p> <h5 id="managed-policy">Managed Policy</h5> <p>There are two types of Managed Policies: AWS-managed policies and Customer-managed policies. They are described below.</p> <p>Criteria for selecting Managed Policies versus Inline policies can be found in the AWS documentation <a href="https://docs.aws.amazon.com/IAM/latest/UserGuide/access_policies_managed-vs-inline.html#choosing-managed-or-inline">here</a>.</p> <h5 id="customer-managed-policy">Customer-managed policy</h5> <p>AWS documentation on Customer-managed policies can be found <a href="https://docs.aws.amazon.com/IAM/latest/UserGuide/access_policies_managed-vs-inline.html#customer-managed-policies">here</a>.</p> <p>The following diagram illustrates customer managed policies. Each policy is an entity in IAM with its own Amazon Resource Name (ARN) that includes the policy name. Notice that the same policy can be attached to multiple principal entities—for example, the same DynamoDB-books-app policy is attached to two different IAM roles.</p> <p><img src="https://docs.aws.amazon.com/IAM/latest/UserGuide/images/policies-customer-managed-policies.diagram.png" alt="Customer-managed policy diagram"></p> <h5 id="aws-managed-policy">AWS-managed policy</h5> <p>An AWS managed policy is a standalone policy that is created and administered by AWS. Standalone policy means that the policy has its own Amazon Resource Name (ARN) that includes the policy name. For example, <code>arn:aws:iam::aws:policy/IAMReadOnlyAccess</code> is an AWS managed policy.</p> <p>AWS documentation on AWS-managed policies can be found <a href="https://docs.aws.amazon.com/IAM/latest/UserGuide/access_policies_managed-vs-inline.html#aws-managed-policies">here</a>.</p> <p>The following diagram (taken from the AWS documentation) illustrates AWS managed policies. The diagram shows three AWS managed policies: AdministratorAccess, PowerUserAccess, and AWSCloudTrailReadOnlyAccess. Notice that a single AWS managed policy can be attached to principal entities in different AWS accounts, and to different principal entities in a single AWS account.</p> <p><img src="https://docs.aws.amazon.com/IAM/latest/UserGuide/images/policies-aws-managed-policies.diagram.png" alt="AWS-managed policy diagram"></p> <h5 id="inline-policy">Inline Policy</h5> <p>An inline policy is a policy that&#39;s embedded in an IAM identity (a user, group, or role). That is, the policy is an inherent part of the identity. You can create a policy and embed it in a identity, either when you create the identity or later.</p> <p>AWS documentation on inline policies can be found <a href="https://docs.aws.amazon.com/IAM/latest/UserGuide/access_policies_managed-vs-inline.html#inline-policies">here</a>.</p> <p>The following diagram illustrates inline policies. Each policy is an inherent part of the user, group, or role. Notice that two roles include the same policy (the DynamoDB-books-app policy), but they are not sharing a single policy; each role has its own copy of the policy.</p> <p><img src="https://docs.aws.amazon.com/IAM/latest/UserGuide/images/policies-inline-policies.diagram.png" alt="Inline policy diagram"></p> <p>Inline policies are useful if you want to maintain a strict one-to-one relationship between a policy and the identity that it&#39;s applied to. For example, you want to be sure that the permissions in a policy are not inadvertently assigned to an identity other than the one they&#39;re intended for. When you use an inline policy, the permissions in the policy cannot be inadvertently attached to the wrong identity. In addition, when you use the AWS Management Console to delete that identity, the policies embedded in the identity are deleted as well. That&#39;s because they are part of the principal entity.</p> ';e.exports=a},facd:function(e,t,a){(function(e,t){t(a("c1df"))})(0,(function(e){"use strict";
